import Header from './Components/Header';
import Home from './Pages/Home';
import { Route } from 'react-router-dom';


function App() {
  return (
    <>
    <Header/>
    <Routes>
    <Route path='/' element={<Home/>}/>
    </Routes>
   <Home/>

    </>
  );
}

export default App;
